declare namespace org {
    namespace bukkit {
        namespace entity {
            namespace Villager {
                /**
                 * Represents the various different Villager professions there may be.
                 * Villagers have different trading options depending on their profession,
                 */
                // @ts-ignore
                class Profession extends java.lang.Enum<org.bukkit.entity.Villager.Profession> implements org.bukkit.Keyed {
                    // @ts-ignore
                    public static readonly NONE: org.bukkit.entity.Villager.Profession
                    /**
                     * Armorer profession. Wears a black apron. Armorers primarily trade for
                     * iron armor, chainmail armor, and sometimes diamond armor.
                     */
                    // @ts-ignore
                    public static readonly ARMORER: org.bukkit.entity.Villager.Profession
                    /**
                     * Butcher profession. Wears a white apron. Butchers primarily trade for
                     * raw and cooked food.
                     */
                    // @ts-ignore
                    public static readonly BUTCHER: org.bukkit.entity.Villager.Profession
                    /**
                     * Cartographer profession. Wears a white robe. Cartographers primarily
                     * trade for explorer maps and some paper.
                     */
                    // @ts-ignore
                    public static readonly CARTOGRAPHER: org.bukkit.entity.Villager.Profession
                    /**
                     * Cleric profession. Wears a purple robe. Clerics primarily trade for
                     * rotten flesh, gold ingot, redstone, lapis, ender pearl, glowstone,
                     * and bottle o' enchanting.
                     */
                    // @ts-ignore
                    public static readonly CLERIC: org.bukkit.entity.Villager.Profession
                    /**
                     * Farmer profession. Wears a brown robe. Farmers primarily trade for
                     * food-related items.
                     */
                    // @ts-ignore
                    public static readonly FARMER: org.bukkit.entity.Villager.Profession
                    /**
                     * Fisherman profession. Wears a brown robe. Fisherman primarily trade
                     * for fish, as well as possibly selling string and/or coal.
                     */
                    // @ts-ignore
                    public static readonly FISHERMAN: org.bukkit.entity.Villager.Profession
                    /**
                     * Fletcher profession. Wears a brown robe. Fletchers primarily trade
                     * for string, bows, and arrows.
                     */
                    // @ts-ignore
                    public static readonly FLETCHER: org.bukkit.entity.Villager.Profession
                    /**
                     * Leatherworker profession. Wears a white apron. Leatherworkers
                     * primarily trade for leather, and leather armor, as well as saddles.
                     */
                    // @ts-ignore
                    public static readonly LEATHERWORKER: org.bukkit.entity.Villager.Profession
                    /**
                     * Librarian profession. Wears a white robe. Librarians primarily trade
                     * for paper, books, and enchanted books.
                     */
                    // @ts-ignore
                    public static readonly LIBRARIAN: org.bukkit.entity.Villager.Profession
                    /**
                     * Mason profession.
                     */
                    // @ts-ignore
                    public static readonly MASON: org.bukkit.entity.Villager.Profession
                    /**
                     * Nitwit profession. Wears a green apron, cannot trade. Nitwit
                     * villagers do not do anything. They do not have any trades by default.
                     */
                    // @ts-ignore
                    public static readonly NITWIT: org.bukkit.entity.Villager.Profession
                    /**
                     * Sheperd profession. Wears a brown robe. Shepherds primarily trade for
                     * wool items, and shears.
                     */
                    // @ts-ignore
                    public static readonly SHEPHERD: org.bukkit.entity.Villager.Profession
                    /**
                     * Toolsmith profession. Wears a black apron. Tool smiths primarily
                     * trade for iron and diamond tools.
                     */
                    // @ts-ignore
                    public static readonly TOOLSMITH: org.bukkit.entity.Villager.Profession
                    /**
                     * Weaponsmith profession. Wears a black apron. Weapon smiths primarily
                     * trade for iron and diamond weapons, sometimes enchanted.
                     */
                    // @ts-ignore
                    public static readonly WEAPONSMITH: org.bukkit.entity.Villager.Profession
                    // @ts-ignore
                    public static values(): org.bukkit.entity.Villager.Profession[]
                    // @ts-ignore
                    public static valueOf(name: java.lang.String | string): org.bukkit.entity.Villager.Profession
                    // @ts-ignore
                    public getKey(): org.bukkit.NamespacedKey
                }
            }
        }
    }
}
